import React, { Component } from 'react';
import data from '../../assets/data.json';

class MainClass extends Component {
  constructor(props) {
    super();
    this.state = {
      data: []
    }
  }

  render() {
    return (
      <div>
        <p>{JSON.stringify(data.classes[0].duration)}</p>
      </div>
    )
  }
}

export default MainClass;
